import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.jsx';
import Card from './Card.jsx';
import './index.css';

import Sdata from './Sdata';


const ncard=()=>{
    Sdata.map()
}

ReactDOM.render(<>

<div className='container'>
<h1 className="heading_name">Top 5 Netflix series </h1>
<div className='cards'>
<Card 
imgsrc={Sdata[0].imgsrc}
itle={Sdata[0].itle}
sname={Sdata[0].sname}
links={Sdata[0].links}

/>


<Card 
imgsrc={Sdata[1].imgsrc}
itle={Sdata[1].itle}
sname={Sdata[1].sname}
links={Sdata[1].links}

/>
<Card 
imgsrc={Sdata[2].imgsrc}
itle={Sdata[2].itle}
sname={Sdata[2].sname}
links={Sdata[2].links}

/>
<Card 
imgsrc={Sdata[3].imgsrc}
itle={Sdata[3].itle}
sname={Sdata[3].sname}
links={Sdata[3].links}

/>
<Card 
imgsrc={Sdata[4].imgsrc}
itle={Sdata[4].itle}
sname={Sdata[4].sname}
links={Sdata[4].links}

/>
</div>              
</div>
</> , document.getElementById("root"));
